import React from 'react';
import ReactDOMServer from 'react-dom/server';
import {VariantViewer} from '../src/sgd_visualization';

test("should render to a viz with classes 'sgd-viz' and 'variant-viewer'",()=>{
	var alignedDnaSequences =[
		{
			id: 1,
			name: "S288C",
			href: "http://yeastgenome.org/strain/S288C/overview",
			sequence: ""
		},
		{
			id: 13,
			name: "RM11-1a",
			href: "http://yeastgenome.org/strain/RM11-1a/overview",
			sequence: "------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------"
		},
		{
			id: 9,
			name: "Y55",
			href: "http://yeastgenome.org/strain/y55/overview",
			sequence: "------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------"
		}
	]
	
	var variantDataDna = [
		{
			start: 1,
			variant_type: "Deletion",
			score: 11,
			end: 355
		},
		{
			snpType: "Synonymous",
			start: 708,
			variant_type: "SNP",
			score: 4,
			end: 709
		},
		{
			snpType: "Synonymous",
			start: 1299,
			variant_type: "SNP",
			score: 2,
			end: 1300
		}
	]
	
	var markup = ReactDOMServer.renderToStaticMarkup(<VariantViewer 	name= {"ACT1"} strand= {"+"} chromStart= {53260} chromEnd={54696}
	blockStarts={[0, 320]} blockSizes={[10, 1117]} dnaLength={1437}
	contigName={"Chromosome VI"}
	contigHref={"http://yeastgenome.org/contig/Chromosome_VI/overview"}
	alignedDnaSequences={alignedDnaSequences}
	variantDataDna={variantDataDna}
	variantDataProtein={null}
	proteinLength={null}
	alignedProteinSequences={null}
	domains={null}
	isProteinMode={false}
	downloadCaption={"SGD 2015 Stanford University"}
	/>)
	
	expect(markup.match('class="sgd-viz variant-viewer')).not.toBeNull()
	expect(markup.match(/<div/).index).toEqual(0)
});